import { atom } from "recoil";

export const themeAtom = atom<Boolean>({
  key: "theme",
  default: false,
});

interface test {
  toDo: string[];
  doing: string[];
  done: string[];
}

export const toDoAtom = atom({
  key: "toDo",
  default: {
    july: [...Array(7)].map((_) =>
      [...Array(6)].map((_) => ({ toDo: [], doing: [], done: [] }))
    ),
    august: [...Array(7)].map((_) =>
      [...Array(6)].map((_) => ({ toDo: [], doing: [], done: [] }))
    ),
  },
});
